LL_RECEIPTS_TITLE:"Print All Campaigns",CONFIRM_DIALOG_PRINT_ALL_RECEIPTS_TEXT:"You are going to see an overview and be able to print only the Completed or Closed campaings of what you have selected",ERR_ENS_NOT_FREE:"username already taken!",ERR_CAMPAIGN_ANALYTICS:"Error getting campaign analytics: ${0}",PRIVILEGES_LEVEL_WARNING_MSG:'You have "${0}" level privileges. Some functionalities may not be available.',ADEX_ACCOUNT:"AdEx account",ERR_INSUFFICIENT_BALANCE_WITHDRAW:"Insuficient account balance: Balance: ${0}, Fees: ${1}, Withdraw amount: ${2}",ERR_ZERO_WITHDRAW_AMOUNT:"Withdraw amount can not be 0",TUTORIAL_CREATE_AD_UNIT_TITLE:"How to create an ad unit",TUTORIAL_CREATE_AD_UNIT_STEP_1:"Go to your Advertiser dashboard > Ad Units and click the <strong>\u201cNew Ad unit\u201d</strong> button.",TUTORIAL_CREATE_AD_UNIT_STEP_2:"Enter a name for your ad unit, add a description (optional).",TUTORIAL_CREATE_AD_UNIT_STEP_3:"Next, point a <strong>URL</strong> where users will land after clicking on your ad.",TUTORIAL_CREATE_AD_UNIT_STEP_4:"Choose the size of the creative you\u2019ll upload. You can add your own UTM tracking or select to add Google UTM tracking.",TUTORIAL_CREATE_AD_UNIT_STEP_5:"Add your ad creative. Keep in mind that it must be the same size as the ad unit for our system to accept it. Press <strong>\u201cContinue\u201d</strong>.",TUTORIAL_CREATE_AD_UNIT_STEP_6:"On the next step, define the targeting for your ad. Filling in these fields is optional, however the more targeting settings you specify, the higher the expected success rate of your ad.",TUTORIAL_CREATE_AD_UNIT_STEP_7:"Set a weight score for each target using the handy slider. This score indicates how important that particular targeting criteria is for your campaign, and helps you achieve a more precise targeting.",TUTORIAL_CREATE_AD_UNIT_STEP_8:"Review if everything looks good, then hit <strong>\u201cSave\u201d</strong>.",TUTORIAL_CREATE_AD_UNIT_END:"The created ad unit will then appear in the <strong>\u201cAd Units\u201d</strong> section of your Advertiser account.",TUTORIAL_FUND_ACC_TITLE:"How to fund your account",TUTORIAL_FUND_ACC_START:"Follow these steps to fund your account:",TUTORIAL_FUND_ACC_STEP_1:"Click on <strong>Account</strong> in the lower left corner of the screen.",TUTORIAL_FUND_ACC_STEP_2:"On your Account screen you will see your <strong>AdEx account and your available balance.</strong>",TUTORIAL_FUND_ACC_STEP_3:"Next to the address you\u2019ll see the <strong>Copy icon</strong>. Just click it and you\u2019ll copy the address.",TUTORIAL_FUND_ACC_STEP_4:"Now that you have it, just send DAI to it using your preferred wallet. Please note that you can only send DAI to your AdEx account.",TUTORIAL_FUND_ACC_MORE_INFO:"Alternatively you can top up your account with GBP. More information can be found ${0}",TUTORIAL_FUND_ACC_END:"When you have enough funds in your Identity address, you can start running campaigns on AdEx Network.",TUTORIAL_LAUNCH_CAMPAIGN_TITLE:"How to launch your first campaign",TUTORIAL_LAUNCH_CAMPAIGN_START:"Follow these steps to launch your first advertising campaign on AdEx.",TUTORIAL_LAUNCH_CAMPAIGN_STEP_1:"On the sidebar menu, click on the <strong>\u201cCampaigns\u201d</strong> and then the <strong>\u201cNew Campaign\u201d</strong> button on the right.",TUTORIAL_LAUNCH_CAMPAIGN_STEP_2:"On the next screen, choose which existing ad units to assign to your campaign. ",TUTORIAL_LAUNCH_CAMPAIGN_STEP_3:"Set the validators, the campaign total budget, your CPM price and start and end dates of your campaign. When you click on the dates slots, a small calendar will open for you to select dates, then hit <strong>\u201cContinue\u201d</strong>.",TUTORIAL_LAUNCH_CAMPAIGN_STEP_4:"When creating a campaign you have the option to select to only show the ad if targeting matches. If you tick this box, then your ad will appear only on such websites which correspond to the targeting criteria specified by you. This may mean your ad may not show if there are no relevant publishers at the moment. But this way you ensure that you won't spend your advertising budget by showing an ad people are not currently interested in.",TUTORIAL_LAUNCH_CAMPAIGN_STEP_5:"Preview your campaign and check if everything looks good. If you need to make any edits, use the <strong>\u201cBack\u201d</strong> button. If things look fine, just save it.",TUTORIAL_LAUNCH_CAMPAIGN_END:"Your campaign is now created and it will start running on the <strong>\u201cStart date\u201d</strong> you have set.",TUTORIAL_CREATE_AD_SLOT_TTILE:"How to create an ad slot",TUTORIAL_CREATE_AD_SLOT_STEP_1:"In the dashboard, click on <strong>\u201cAd Slots\u201d</strong> on the left sidebar menu.",TUTORIAL_CREATE_AD_SLOT_STEP_2:"Click on the <strong>\u201cNew Ad Slot\u201d</strong> button in the upper right corner.",TUTORIAL_CREATE_AD_SLOT_STEP_3:"Fill in the <strong>name of your ad slot</strong> (mandatory) and its description (optional).",TUTORIAL_CREATE_AD_SLOT_STEP_4:"From the bottom dropdown menu choose the size of your ad slot. Be sure to match the size of your inventory, otherwise the ads won\u2019t display properly.",TUTORIAL_CREATE_AD_SLOT_STEP_5:"Set your passback image preferences. If you select a passback image and URL, they will be displayed when no matching ads are available for this slot. Otherwise the ad slot will be hidden automatically. If you choose to use a passback image, make sure that the image you upload matches your ad slot size.",TUTORIAL_CREATE_AD_SLOT_STEP_6:"Time to adjust <strong>targeting options</strong> for your ad slot. You can add both predefined affinity categories and/or create and add custom targeting categories. For each targeting category you can add weight from 0 to 100\u200a\u2014\u200adefining how strong is this targeting.",TUTORIAL_CREATE_AD_SLOT_STEP_7:"Preview your ad slot settings. Looking good? Hit <strong>\u201cSave\u201d</strong>. Forgot to add something? Click on <strong>\u201cBack\u201d</strong>.",TUTORIAL_CR